import React, {useState, useEffect} from "react";

const Home = (props) => {
    const[posts, setPosts] = useState([]);

    useEffect(()=>{
        setPosts(props.data);
    }
    ,[]);

    return(
        <div className="container">
            {posts}
        </div>
    )
}

export default Home;
